import Svgmain from "./images/Svgmain.svg";

const { directive } = require("@babel/types");


function Hero()
{
    return(
        <div className="w-screen h-screen p-0 m-0 inline-grid grid-cols-4 grid-rows-3" id="main-hero">
            <div className="grid-flow-row row-start-2 col-start-2 mx-auto my-28 w-32 " id="main-svg">
                <img src={require("./images/placeholderimage.jpg")} className="w-24 h-22"/>
            </div>
        </div>
    )
}

export default Hero;
